import Layout from "../layout/Layout"
import ScreenshotViewer from "../components/main/challenge/ScreenshotViewer"
import TableTop from "../components/main/challenge/TableTop"
import TableBottom from "../components/main/challenge/TableBottom"
import { connect } from "react-redux";
import { startGame } from "../redux/actions";


const mapState = state => ({
    games: state.game_database,
    game_status: state.game_status,
})

const mapDispatch  = dispatch => ({
  startGame: (difficulty) => dispatch(startGame(difficulty)),
})

function HomePage({games, game_status, startGame}) {
  return (
    <>
    <Layout title="Challenge">
        <ScreenshotViewer games={games} game_status={game_status}/>
        <TableTop game_status={game_status} startGame={startGame}/>
        <TableBottom game_status={game_status}/>
    </Layout>
    </>
  )
}

export default connect(mapState, mapDispatch)(HomePage);
